import React, {useState, useEffect} from 'react';
import socket from './Socket';

export function UserList(){
    const [users, setUsers] = useState([]);

    useEffect(() =>{
        socket.on("userList", function(array){
            setUsers(array);
        })
    })
    return(
        <div>
            {users}
        </div>
    );
}
